DROP TABLE IF EXISTS mytable;
CREATE TABLE IF NOT EXISTS mytable(
   `Date`                    VARCHAR(17) NOT NULL PRIMARY KEY
  ,`Open_Price`              NUMERIC(7,2) NOT NULL
  ,`High_Price`              NUMERIC(7,2) NOT NULL
  ,`Low_Price`               NUMERIC(7,2) NOT NULL
  ,`Close_Price`             NUMERIC(7,2) NOT NULL
  ,`WAP`                     NUMERIC(23,18) NOT NULL
  ,`Noof_Shares`             INTEGER  NOT NULL
  ,`No_of_Trades`            INTEGER  NOT NULL
  ,`Total_Turnover_Rs`       NUMERIC(13,2) NOT NULL
  ,`Deliverable_Quantity`    INTEGER 
  ,`_Deli_Qty_to_Traded_Qty` NUMERIC(5,2)
  ,`Spread_HighLow`          NUMERIC(6,2) NOT NULL
  ,`Spread_CloseOpen`        NUMERIC(7,2) NOT NULL
);


ALTER TABLE mytable 
  ADD new_date DATE NOT NULL; 

SET SQL_SAFE_UPDATES = 0;
UPDATE mytable temp1
JOIN 
       ( 
              SELECT Str_to_date(`date`,'%d-%M-%Y')AS d, 
                     date                          AS f
              FROM   mytable )temp2 
set    temp1.new_date = temp2.d 
WHERE  temp1.date=temp2.f;

ALTER TABLE mytable 
  DROP COLUMN date; 

ALTER TABLE mytable 
  CHANGE new_date `date` DATE NOT NULL PRIMARY KEY; 

