ALTER TABLE mytable2 
  modify row_num INT; 

DROP TABLE IF EXISTS bajaj1; 

CREATE TABLE IF NOT EXISTS bajaj1 
  ( 
     `date`        VARCHAR(17) NOT NULL PRIMARY KEY, 
     `close_price` NUMERIC(7, 2) NOT NULL, 
     `20 day ma`   NUMERIC(23, 4), 
     `50 day ma`   NUMERIC(23, 4) 
  ); 


             close_price, 
             `20 day ma`, 
             `50 day ma`) 
SELECT date, 
       close_price, 
       Round((SELECT Sum(close_price) / Count(close_price) 
              FROM   mytable2 AS b 
              WHERE  a.row_num - b.row_num BETWEEN 0 AND 19), 2) AS '20 Day MA', 
       Round((SELECT Sum(close_price) / Count(close_price) 
              FROM   mytable2 AS b 
              WHERE  a.row_num - b.row_num BETWEEN 0 AND 49), 2) AS '50 Day MA' 
FROM   mytable2 AS a 
ORDER  BY a.date; 

DROP TABLE IF EXISTS mytable2; 

SET SQL_SAFE_UPDATES = 0;
UPDATE bajaj1 temp1 
JOIN 
       (        SELECT   Row_number() OVER (ORDER BY date)AS row_num, 
                         date 
                FROM     bajaj1 ) temp2
set    temp1.`20 DAY MA` = NULL 
WHERE  temp1.date=temp2.date AND    temp2.row_num<20;


SET SQL_SAFE_UPDATES = 0;
UPDATE bajaj1 temp1 
JOIN 
       (        SELECT   Row_number() OVER (ORDER BY date)AS row_num, 
                         date 
                FROM     bajaj1 ) temp2
set    temp1.`50 DAY MA` = NULL 
WHERE  temp1.date=temp2.date AND    temp2.row_num<50;

SELECT * 
FROM   bajaj1; 

